const uint8_t* GetGlyphBmp(int c)
{
	if (c<32)  c=127;
	if (c>127) c=127;
	int offset=0;
	if (c=='i' || c=='j')  offset=-1;
	return &fontMono24bmp[(c-32)*GetGlyphHeight()*GetGlyphPitch()+offset];
}

